"use strict";(self.webpackChunkblog=self.webpackChunkblog||[]).push([[9586],{269:function(n){n.exports=JSON.parse('{"blogPosts":[{"id":"typescript-3.7","metadata":{"permalink":"/Blog/typescript/typescript-3.7","source":"@site/typescript/2021-12-05-typescript-3.7.md","title":"Typescript 3.7 \u5e38\u7528\u65b0\u7279\u6027","description":"\u5199\u5728\u524d\u9762","date":"2021-12-05T00:00:00.000Z","formattedDate":"December 5, 2021","tags":[{"label":"typescript","permalink":"/Blog/typescript/tags/typescript"}],"readingTime":2.735,"truncated":false,"authors":[],"nextItem":{"title":"Typescript 3.8 \u5e38\u7528\u65b0\u7279\u6027","permalink":"/Blog/typescript/typescript-3.8"}},"content":"## \u5199\u5728\u524d\u9762\\n\\n\u4e0d\u662f\u5b8c\u6574\u7684\u7248\u672c\u65b0\u7279\u6027\uff0c\u8fd9\u91cc\u53ea\u5199\u51fa\u4e86\u6211\u89c9\u5f97\u5e38\u7528\u7684\u65b0\u7279\u6027\\n\\n## \u53ef\u9009\u94fe\u5f0f\u8fd0\u7b97\u7b26 ?.\\n\\njs \u4e5f\u652f\u6301\u4e86\u8fd9\u4e2a\u7279\u6027\\n\\n`obj?.prop` \u5f53 obj \u4e3a null/undefined \u5f0f\u76f4\u63a5\u8fd4\u56de undefined\uff0c\u53ef\u4ee5\u7528\u6765\u4ee3\u66ff`obj && obj.prop`\\n\\n```typescript\\n// Before\\nif (foo && foo.bar && foo.bar.baz) {\\n  // ...\\n}\\n\\n// After-ish\\nif (foo?.bar?.baz) {\\n  // ...\\n}\\n```\\n\\n- \u53ef\u4ee5\u7528\u4e8e\u8bbf\u95ee\u6570\u7ec4\u6216\u8005\u5f0f\u5bf9\u8c61\u7d22\u5f15\\n\\n```typescript\\narr?.[1];\\nconst name = \\"name\\";\\nobj?.[name];\\n```\\n\\n- \u53ef\u4ee5\u7528\u4e8e\u51fd\u6570\u8c03\u7528\\n\\n```typescript\\nobj.func?.(123);\\n```\\n\\n## \u7a7a\u5408\u5e76\u8fd0\u7b97\u7b26 ??\\n\\n`a ?? b` \u5f53 a \u4e3a null/undefined \u7684\u65f6\u5019\u8fd4\u56de b\uff0c\u5176\u4f59\u8fd4\u56de a\\n\\n### ?? \u548c && \u7684\u533a\u522b\\n\\n`&&`\u8fd0\u7b97\u7b26\u5f53\u524d\u9762\u7684\u53d8\u91cf\u5f0f\u5047\u503c\uff08false/0/null/undefined/NaN/\'\'\uff09\u5f0f\u90fd\u4f1a\u8fd4\u56de\u540e\u9762\u7684\u53d8\u91cf\uff0c\u6709\u65f6\u5019\u8fd9\u53ef\u80fd\u4e0d\u662f\u6211\u4eec\u60f3\u8981\u7684\uff1b`??`\u5219\u53ea\u4f1a\u8fc7\u6ee4 null \u548c undefined\\n\\n## type \u7684\u6269\u5c55\u4f7f\u7528\\n\\n- type \u7c7b\u578b\u5b9a\u4e49\u65f6\u53ef\u4ee5\u4f7f\u7528\u81ea\u5df1\\n\\n```typescript\\ntype Json =\\n  | string\\n  | number\\n  | boolean\\n  | null\\n  | { [property: string]: Json }\\n  | Json[];\\n```\\n\\n## \u65ad\u8a00\u6269\u5c55\\n\\nthrow \u5982\u679c\u53d1\u751f\u610f\u5916\u60c5\u51b5\uff0c\u5219\u6709\u4e00\u7ec4\u7279\u5b9a\u7684\u51fd\u6570\u4f1a\u51fa\u9519\u3002\u5b83\u4eec\u88ab\u79f0\u4e3a\u201c\u65ad\u8a00\u201d\u529f\u80fd\u3002\u4f8b\u5982\uff0cNode.js \u4e3a\u6b64\u6709\u4e00\u4e2a\u4e13\u7528\u529f\u80fd assert\u3002\\n\\n```javascript\\nassert(someValue === 42);\\n```\\n\\n\u5728\u6b64\u793a\u4f8b\u4e2d\uff0c\u5982\u679c someValue \u4e0d\u7b49\u4e8e 42\uff0cassert \u5219\u5c06\u629b\u51fa AssertionError\u3002\\n\\nJavaScript \u4e2d\u7684\u65ad\u8a00\u901a\u5e38\u7528\u4e8e\u9632\u6b62\u4f20\u5165\u4e0d\u6b63\u786e\u7684\u7c7b\u578b\u3002\u4f8b\u5982:\\n\\n```javascript\\nfunction multiply(x, y) {\\n  assert(typeof x === \\"number\\");\\n  assert(typeof y === \\"number\\");\\n\\n  return x * y;\\n}\\n```\\n\\nTypeScript 3.7 \u5f15\u5165\u4e86\u4e00\u4e2a\u79f0\u4e3a\u201c\u65ad\u8a00\u7b7e\u540d\u201d\u7684\u65b0\u6982\u5ff5\uff0c\u53ef\u4ee5\u5bf9\u8fd9\u4e9b\u65ad\u8a00\u51fd\u6570\u8fdb\u884c\u5efa\u6a21\u3002\\n\u786e\u4fdd\u5728\u5305\u542b\u8303\u56f4\u7684\u5176\u4f59\u90e8\u5206\u4e2d\uff0c\u65e0\u8bba\u68c0\u67e5\u4ec0\u4e48\u6761\u4ef6\u90fd\u5fc5\u987b\u4e3a\u771f\u3002\\n\\n```typescript\\nfunction assert(condition: any, msg?: string): asserts condition {\\n  if (!condition) {\\n    throw new TypeError(msg);\\n  }\\n}\\n```\\n\\n```typescript\\nfunction yell(str) {\\n  assert(typeof str === \\"string\\");\\n\\n  return str.toUppercase();\\n  //         ~~~~~~~~~~~\\n  // error: Property \'toUppercase\' does not exist on type \'string\'.\\n  //        Did you mean \'toUpperCase\'?\\n}\\n\\nfunction assert(condition: any, msg?: string): asserts condition {\\n  if (!condition) {\\n    throw new TypeError(msg);\\n  }\\n}\\n```\\n\\n\u65ad\u8a00\u7b7e\u540d\u7684\u53e6\u4e00\u79cd\u7c7b\u578b\u4e0d\u68c0\u67e5\u6761\u4ef6\uff0c\u800c\u662f\u544a\u8bc9 TypeScript \u7279\u5b9a\u7684\u53d8\u91cf\u6216\u5c5e\u6027\u5177\u6709\u4e0d\u540c\u7684\u7c7b\u578b\u3002\u5176\u4f59\u8303\u56f4\u5185 val \u4e00\u5b9a\u662f string\uff0c\u7c7b\u4f3c\u4e8e\u7c7b\u578b\u5b88\u536b\\n\\n```typescript\\nfunction assertIsString(val: any): asserts val is string {\\n  if (typeof val !== \\"string\\") {\\n    throw new TypeError(\\"Not a string!\\");\\n  }\\n}\\n```"},{"id":"typescript-3.8","metadata":{"permalink":"/Blog/typescript/typescript-3.8","source":"@site/typescript/2021-12-05-typescript-3.8.md","title":"Typescript 3.8 \u5e38\u7528\u65b0\u7279\u6027","description":"\u7c7b\u578b\u9650\u5236\u7684\u5bfc\u5165\u5bfc\u51fa\u65b9\u6cd5 (Type-Only Imports and Export)","date":"2021-12-05T00:00:00.000Z","formattedDate":"December 5, 2021","tags":[{"label":"typescript","permalink":"/Blog/typescript/tags/typescript"}],"readingTime":5.365,"truncated":false,"authors":[],"prevItem":{"title":"Typescript 3.7 \u5e38\u7528\u65b0\u7279\u6027","permalink":"/Blog/typescript/typescript-3.7"},"nextItem":{"title":"Typescript 3.9 \u5e38\u7528\u65b0\u7279\u6027","permalink":"/Blog/typescript/typescript-3.9"}},"content":"## \u7c7b\u578b\u9650\u5236\u7684\u5bfc\u5165\u5bfc\u51fa\u65b9\u6cd5 (Type-Only Imports and Export)\\n\\nTypeScript 3.8 \u4e3a\u4ec5\u7c7b\u578b\u5bfc\u5165\u548c\u5bfc\u51fa\u6dfb\u52a0\u4e86\u65b0\u8bed\u6cd5\u3002\u6b64\u65f6\u5bfc\u5165\u3001\u5bfc\u51fa\u7684\u53d8\u91cf\u53ea\u80fd\u4f5c\u4e3a\u7c7b\u578b\u4f7f\u7528\\n\\n```typescript\\nimport type { SomeThing } from \\"./some-module.js\\";\\n\\nexport type { SomeThing };\\n```\\n\\n```typescript\\nimport type { Component } from \\"react\\";\\n\\ninterface ButtonProps {\\n    // ...\\n}\\n\\nclass Button extends Component<ButtonProps> {\\n    //               ~~~~~~~~~\\n    // error! \'Component\' only refers to a type, but is being used as a value here.\\n\\n    // ...\\n}\\n```\\n\\n## ECMAScript \u63d0\u6848\u7684\u79c1\u6709\u5b57\u6bb5\uff08ECMAScript Private Fields\uff09\\n\\n### Private Fields \u7684\u57fa\u672c\u7279\u6027\\n\\n- js \u4e2d\u5df2\u7ecf\u6709\u63d0\u6848\uff0c\u4f46\u662f\u6d4f\u89c8\u5668\u4e2d\u8fd8\u4e0d\u652f\u6301\\n\\n- typescript \u4e2d\u5df2\u7ecf\u53ef\u4ee5\u4f7f\u7528`#`\u6765\u5b9a\u4e49\u771f\u6b63\u7684\u79c1\u6709\u5c5e\u6027\u4e86\\n\\n```typescript\\nclass Person {\\n    #name: string\\n\\n    constructor(name: string) {\\n        this.#name = name;\\n    }\\n\\n    greet() {\\n        console.log(`Hello, my name is ${this.#name}!`);\\n    }\\n}\\n\\nlet jeremy = new Person(\\"Jeremy Bearimy\\");\\n\\njeremy.#name\\n//     ~~~~~\\n// Property \'#name\' is not accessible outside class \'Person\'\\n// because it has a private identifier.\\n```\\n\\n\u26a0\ufe0f \u548c\u5e38\u89c4\u5c5e\u6027(\u8fd9\u91cc\u7279\u522b\u6bd4\u8f83 private \u4fee\u9970\u7b26\u58f0\u660e\u7684\u6bd4\u8f83)\u4e0d\u540c\uff0c\u79c1\u6709\u5b57\u6bb5(private fields)\u62e5\u6709\u4e0b\u9762\u8fd9\u4e9b\u7279\u6027\u3002\\n\\n- \u4e13\u7528\u5b57\u6bb5\u4ee5 # \u5b57\u7b26\u5f00\u5934\u3002\u6709\u65f6\u6211\u4eec\u79f0\u8fd9\u4e9b prviate name\u3002\\n- \u6bcf\u4e2a\u4e13\u7528\u5b57\u6bb5\u540d\u79f0\u90fd\u552f\u4e00\u5730\u9650\u5b9a\u4e8e\u5176\u5305\u542b\u7684\u7c7b\u3002\\n- TypeScript \u8f85\u52a9\u529f\u80fd\u4fee\u9970\u7b26\uff0c\u4f8b\u5982 public\uff0cprivate \u4e0d\u80fd\u5728\u79c1\u6709\u5b57\u6bb5\u4e0a\u4f7f\u7528\u3002\\n\\n### Private Fields \u7684\u4f7f\u7528\u89c4\u8303\\n\\n\u9664\u4e86\u80fd\u4fdd\u5b58\u81ea\u5df1\u7684\u79c1\u6709\u8fd9\u4e00\u5c5e\u6027\u4ee5\u5916\uff0c\u79c1\u6709\u5b57\u6bb5\u7684\u53e6\u4e00\u4e2a\u597d\u5904\u662f\u6211\u4eec\u521a\u624d\u63d0\u5230\u7684\u552f\u4e00\u6027\u3002\u4f8b\u5982\uff0c\u5e38\u89c4\u5c5e\u6027\u58f0\u660e\u6613\u4e8e\u5728\u5b50\u7c7b\u4e2d\u88ab\u8986\u76d6\u3002\u800c `private fields` \u662f\u53d7\u4fdd\u62a4\u7684\u3002\\n\\n```typescript\\nclass C {\\n  foo = 10;\\n\\n  cHelper() {\\n    return this.foo;\\n  }\\n}\\n\\nclass D extends C {\\n  foo = 20;\\n\\n  dHelper() {\\n    return this.foo;\\n  }\\n}\\n\\nlet instance = new D();\\n// \'this.foo\' refers to the same property on each instance.\\nconsole.log(instance.cHelper()); // prints \'20\'\\nconsole.log(instance.dHelper()); // prints \'20\'\\n```\\n\\n### \u90a3\u6211\u4eec\u5230\u5e95\u8be5\u4f7f\u7528 # \u5b9a\u5236\u7684\u79c1\u6709\u5b57\u6bb5\u8fd8\u662f\u4f7f\u7528 private \u4fee\u9970\u7b26?\\n\\n\u5f53\u6d89\u53ca\u5230\u5c5e\u6027\u65f6\uff0cTypeScript \u7684`private`\u4fee\u9970\u7b26\u4f1a\u5e76\u6ca1\u6709\u5b8c\u5168\u6b63\u786e\u7684\u6267\u884c\uff0c\u5b83\u7684\u884c\u4e3a\u5b8c\u5168\u50cf\u666e\u901a\u5c5e\u6027\u4e00\u6837\uff0c\u6211\u4eec\u79f0\u4e4b\u4e3a `soft privacy`, \u6211\u4eec\u4f9d\u7136\u53ef\u4ee5\u901a\u8fc7 `[\'foo\']` \u8fd9\u6837\u7684\u5f62\u5f0f\u8bbf\u95ee\u5230\u3002\u770b\u4e0b\u9762\u7684\u4ee3\u7801\uff1a\\n\\n```typescript\\nclass C {\\n  private foo = 10;\\n}\\n\\n// This is an error at compile time,\\n// but when TypeScript outputs .js files,\\n// it\'ll run fine and print \'10\'.\\nconsole.log(new C().foo); // prints \'10\'\\n//                  ~~~\\n// error! Property \'foo\' is private and only accessible within class \'C\'.\\n\\n// TypeScript allows this at compile-time\\n// as a \\"work-around\\" to avoid the error.\\nconsole.log(new C()[\\"foo\\"]); // prints \'10\'\\n```\\n\\n\u5bf9\u6bd4\u4e0b\u9762\u4f7f\u7528 `#` \u79c1\u6709\u5b57\u6bb5\uff0c\u662f\u5b8c\u5168\u8bbf\u95ee\u4e0d\u5230\u7684\\n\\n```typescript\\nclass C {\\n    #foo = 10;\\n}\\n\\nconsole.log(new C().#foo); // SyntaxError\\n//                  ~~~~\\n// TypeScript reports an error *and*\\n// this won\'t work at runtime!\\n\\nconsole.log(new C()[\\"#foo\\"]); // prints undefined\\n//          ~~~~~~~~~~~~~~~\\n// TypeScript reports an error under \'noImplicitAny\',\\n// and this prints \'undefined\'.\\n```\\n\\n**\u7ed3\u8bba\u5c31\u662f\uff0c\u5982\u679c\u4f60\u60f3\u4e25\u683c\u7684\u4fdd\u62a4\u60a8\u7684\u79c1\u6709\u5c5e\u6027\u7684\u503c\uff0c\u5c31\u4f7f\u7528 `#` \u5373\u53ef\uff0c\u5b50\u7c7b\u7ee7\u627f\u7684\u65f6\u5019\u4e5f\u65e0\u9700\u62c5\u5fc3\u547d\u540d\u51b2\u7a81\u7684\u95ee\u9898\u3002\u5f53\u6211\u4eec\u8fd8\u662f\u4f7f\u7528 `private` \u7684\u65f6\u5019\u5c31\u9700\u8981\u6ce8\u610f\u5bf9\u79c1\u6709\u4fee\u9970\u7b26\u7684\u5b9a\u4e49\u7684\u503c\u4fee\u6539\u7684\u95ee\u9898\u4e86.**\\n\\n## export \\\\* as xxx \u8bed\u6cd5\u4f7f\u7528\\n\\ntypescript \u4e5f\u652f\u6301\u8fd9\u79cd\u7528\u6cd5\u5566\uff0c\u5728\u5bfc\u5165\u6a21\u5757\u7684 as \u91cd\u65b0\u5b9a\u4e49\u6a21\u5757\u540d\u7684\u6a21\u5757\u7684\u65f6\u5019\uff0c\u6211\u4eec\u53ef\u4ee5\u91cd\u65b0\u5bfc\u51fa\u5230\u5355\u72ec\u6a21\u5757\u540d\u3002\\n\\nmenu.ts\\n\\n```typescript\\nexport const MENU1 = \\"nav: \u83dc\u5355 1\\";\\nexport const MENU2 = \\"nav: \u83dc\u5355 2\\";\\nexport const MENU3 = \\"nav: \u83dc\u5355 3\\";\\nexport const MENU4 = \\"nav: \u83dc\u5355 4\\";\\nexport const DEMO = \\"nav:Demo\\";\\n```\\n\\nindex.ts\\n\\n```typescript\\nimport * as menu from \\"./menu.ts\\";\\nconsole.log(menu.MENU1); // \'nav: \u83dc\u5355 1\'\uff1b\\nconsole.log(menu.MENU2); // \'nav: \u83dc\u5355 2\'\uff1b\\n// ....\\n\\nexport { menu };\\n```\\n\\n### `import * as React from \'react\'; vs import React from \'react\';` \u8fd9\u4e24\u4e2a\u4f7f\u7528\u6709\u4ec0\u4e48\u533a\u522b?\\n\\n\u7b80\u800c\u8a00\u4e4b\u5c31\u662f\u6211\u4eec\u4f7f\u7528\u7684 `import React from \'react\'` \u5176\u5b9e\u662f\u5bfc\u51fa\u7684\u9ed8\u8ba4\u7684\u6a21\u5757\uff0c\u800c\u7528\u5230 `* as` \u662f\u5bfc\u51fa\u5168\u90e8\u6a21\u5757\u3002\\n\\n## \u9876\u5c42 await \u4f7f\u7528\\n\\njs \u4e5f\u652f\u6301\u5566 \ud83d\ude04\\n\\n```typescript\\nconst response = await fetch(\\"...\\");\\nconst greeting = await response.text();\\nconsole.log(greeting);\\n\\n// Make sure we\'re a module\\nexport {};\\n```\\n\\n> \u6ce8\u610f\uff1a\u9876\u5c42 await \u53ea\u4f1a\u5728\u6a21\u5757\u4e2d\u8d77\u4f5c\u7528\uff0c\u5728\u975e\u6a21\u5757\u6587\u4ef6\u4e2d\u4f7f\u7528\u4f1a\u62a5\u9519\u3002\u9876\u5c42 await \u4ec5\u5728\u6a21\u5757\u7684\u9876\u5c42\u8d77\u4f5c\u7528\uff0c\u5e76\u4e14\u53ea\u6709\u5f53 TypeScript \u627e\u5230\u4e00\u4e2a\u771f\u6b63\u53ef\u7528\u7684\u6a21\u5757\u624d\u5141\u8bb8\u4f7f\u7528\uff0c\u6211\u4eec\u53ef\u4ee5\u7528\u4e00\u4e2a export {} \u6765\u68c0\u6d4b\u662f\u5426\u5728\u6a21\u5757\u4e0b\u4f7f\u7528\u3002\\n\\n```typescript\\nconst response = await fetch(\\"...\\");\\nconst greeting = await response.text();\\nconsole.log(greeting);\\n\\n// \'await\' expressions are only allowed at the top level of a file when that file is a module, but this file has no imports or exports. Consider adding an empty \'export {}\' to make this file a module.\\n```"},{"id":"typescript-3.9","metadata":{"permalink":"/Blog/typescript/typescript-3.9","source":"@site/typescript/2021-12-05-typescript-3.9.md","title":"Typescript 3.9 \u5e38\u7528\u65b0\u7279\u6027","description":"\u5199\u5728\u524d\u9762","date":"2021-12-05T00:00:00.000Z","formattedDate":"December 5, 2021","tags":[{"label":"typescript","permalink":"/Blog/typescript/tags/typescript"}],"readingTime":2.05,"truncated":false,"authors":[],"prevItem":{"title":"Typescript 3.8 \u5e38\u7528\u65b0\u7279\u6027","permalink":"/Blog/typescript/typescript-3.8"}},"content":"## \u5199\u5728\u524d\u9762\\n\\n\u6311\u91cd\u70b9\u7684\u8bb2\u4e00\u8bb2\\n\\n## \u5728\u6761\u4ef6\u8bed\u53e5\u4e2d\u68c0\u6d4b\u672a\u8c03\u7528\u7684\u51fd\u6570\\n\\n- \u5728 3.7 \u7684\u65f6\u5019\u5f15\u5165\u4e86\u68c0\u6d4b\u672a\u8c03\u7528\u51fd\u6570\u9519\u8bef\u63d0\u793a\uff0c3.9 \u505a\u4e86\u90e8\u5206\u4f18\u5316\\n\\n```typescript\\nfunction hasImportantPermissions(): boolean {\\n  // ...\\n}\\n// Oops!\\nif (hasImportantPermissions) {\\n  //  ~~~~~~~~~~~~~~~~~~~~~~~\\n  // This condition will always return true since the function is always defined.\\n  // Did you mean to call it instead?\\n  deleteAllTheImportantFiles();\\n}\\n```\\n\\n\u4f46\u662f\uff0c\u6b64\u9519\u8bef\u4ec5\u9002\u7528\u4e8e if \u8bed\u53e5\u4e2d\u7684\u6761\u4ef6\u3002\u73b0\u5728\u4e09\u5143\u6761\u4ef6\uff08\u5373\u8bed\u6cd5\uff09\u73b0\u5728\u4e5f\u652f\u6301\u6b64\u529f\u80fd\u3002\\n\\n```typescript\\ndeclare function listFilesOfDirectory(dirPath: string): string[];\\ndeclare function isDirectory(): boolean;\\nfunction getAllFiles(startFileName: string) {\\n  const result: string[] = [];\\n  traverse(startFileName);\\n  return result;\\n  function traverse(currentPath: string) {\\n    return isDirectory\\n      ? //     ~~~~~~~~~~~\\n        // This condition will always return true\\n        // since the function is always defined.\\n        // Did you mean to call it instead?\\n        listFilesOfDirectory(currentPath).forEach(traverse)\\n      : result.push(currentPath);\\n  }\\n}\\n```\\n\\n## \u89e3\u6790\u53ef\u9009\u94fe\u4e0e\u975e null \u65ad\u8a00\u4e2d\u7684\u5dee\u5f02\\n\\n- TypeScript \u6700\u8fd1\u5b9e\u73b0\u4e86\u5bf9\u53ef\u9009\u94fe\u64cd\u4f5c\u7b26\u7684\u652f\u6301\uff0c\u4f46\u6839\u636e\u5e7f\u5927\u4f7f\u7528\u8005\u7684\u53cd\u9988\uff0c\u975e null \u65ad\u8a00\u64cd\u4f5c\u7b26\uff08!\uff09\u7684\u53ef\u9009\u94fe\uff08?.\uff09\u884c\u4e3a\u4e0d\u7b26\u5408\u76f4\u89c9\u3002\\n\\n```typescript\\nfoo?.bar!.baz;\\n```\\n\\n\u88ab\u89e3\u91ca\u4e3a\u7b49\u6548\u4e8e\u4ee5\u4e0b JavaScript \u4ee3\u7801\uff1a\\n\\n```javascript\\n(foo?.bar).baz;\\n```\\n\\n> \u5728\u4ee5\u4e0a\u4ee3\u7801\u4e2d\uff0c\u62ec\u53f7\u4f1a\u963b\u6b62\u53ef\u9009\u94fe\u7684\u201c\u77ed\u8def\u201d\u884c\u4e3a\uff1b\u56e0\u6b64\u5982\u679c\u672a\u5b9a\u4e49 foo \u4e3a undefined\uff0c\u5219\u8bbf\u95ee baz \u4f1a\u5f15\u53d1\u8fd0\u884c\u65f6\u9519\u8bef\u3002\\n\\n\u6362\u53e5\u8bdd\u8bf4\uff0c\u5927\u591a\u6570\u4eba\u8ba4\u4e3a\u4ee5\u4e0a\u539f\u59cb\u4ee3\u7801\u7247\u6bb5\u5e94\u8be5\u88ab\u89e3\u91ca\u4e3a\u5728\uff1a\\n\\n```typescript\\nfoo?.bar.baz;\\n```\\n\\n\u4e2d\uff0c\u5f53 foo \u4e3a undefined \u65f6\uff0c\u8ba1\u7b97\u7ed3\u679c\u4e3a undefined\u3002\\n\\n\u8fd9\u662f\u4e00\u9879\u91cd\u5927\u53d8\u5316\uff0c\u4f46\u6211\u4eec\u8ba4\u4e3a\u5927\u90e8\u5206\u4ee3\u7801\u5728\u7f16\u5199\u65f6\u90fd\u662f\u4e3a\u4e86\u8003\u8651\u65b0\u7684\u89e3\u91ca\u573a\u666f\u3002\u5982\u679c\u60a8\u5e0c\u671b\u7ee7\u7eed\u4f7f\u7528\u65e7\u6709\u884c\u4e3a\uff0c\u5219\u53ef\u5728!\u64cd\u4f5c\u7b26\u5de6\u4fa7\u6dfb\u52a0\u62ec\u53f7\uff0c\u5982\u4e0b\u6240\u793a\uff1a\\n\\n```\\n(foo?.bar)!.baz;\\n```"}]}')}}]);